;; **
;;; ## Using Hough Circles
;; **

;; @@
(def hsv (-> img clone (cvt-color! COLOR_RGB2HSV)))
(def thresh-image (new-mat))
(in-range hsv (new-scalar 70 100 100) (new-scalar 103 255 255) thresh-image)

(dotimes [_ 1]
 (dilate! thresh-image (new-mat)))

; the ball is here
(u/mat-view thresh-image)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"176\" height=\"144\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x55b4b96f \"BufferedImage@55b4b96f: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@44aaa64 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 176 height = 144 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@

(def circles (new-mat))
(def minRadius 10)
(def maxRadius 50)
(hough-circles thresh-image circles CV_HOUGH_GRADIENT 1 minRadius 120 15 minRadius maxRadius)

(println circles)
;; @@
;; ->
;;; #object[org.opencv.core.Mat 0x71d125cf Mat [ 1*1*CV_32FC3, isCont=true, isSubmat=false, nativeObj=0x7ff093e5d2f0, dataAddr=0x7ff09392ee80 ]]
